import React, { useState } from 'react';

import logo from './../images/GitHubLogo.png';
import searchIconSmall from './../images/SearchIconSmall.png';

import Input from './common/Input';

function Nav(){
    const [inputValue, setInputValue] = useState('');

    function handleChange(value){
        setInputValue(value);
    }

    return(
        <nav className="nav">
            <div className="container">
                <div className="nav-wrapper">
                    <div className="logo-block">
                        <img src={logo} alt="Logo image"></img>
                    </div>
                    <div className="search-block">
                        <img src={searchIconSmall} alt="Search icon"></img>
                        <Input value={inputValue} onChange={(event) => handleChange(event.target.value)} className="search-field" type="text" placeholder="Enter GitHub username" />
                    </div>
                </div>
            </div>
        </nav>
    );
}

export default Nav;
